import Home from './components/guest/barra'
import Bus from './components/guest/busqueda'
import Guest from './components/guest/carrousel'

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return( 
    <Router>
      <Home />
      <Bus/>
      <Guest/>
      <Switch>
        <Route path= "/login">
          <Homes/>
        </Route>
      </Switch>
    </Router>

  );
}

function Homes() {
  return <h2>Home</h2>;
}

export default App;
